VOGUE USA tribute to the eternally inspiring  KARL LAGERFELD

Thank you Vogue and Alex Harrington for including me in the echelon of muses that inspired Karl during the span of his profile career. It’s an honor to continue to serve his creative force years after his passing in Thom Browne’s beautiful creation. Annie Leibovitz captures the depth of Karl inspired creations with the spectacular backdrop of the Grand Palais. 

Karl will forever stand as an indomitable force in fashion. This tribute is a testament to breadth of his expansive career and the longevity of his visions.

